import React from 'react';

const SuperItemAdded = React.memo(() => {

    //id	firstName	lastName	email	phone	address	description

    return <div>
        <button>Add item in table</button>
        <div>id <input /></div>
        <div>firstName <input /></div>
        <div>lastName <input /></div>
        <div>email <input /></div>
        <div>phone <input /></div>
        <div>address <input /></div>
        <div>description <input /></div>
    </div>
});

export default SuperItemAdded;
